INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1001, 0, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 1, "春咲 ひより", 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1002, 0, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 1, "草野 優衣", 1.4, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1003, 0, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 1, 1, "士条 怜", 1.4, "フェンシングを始めてみては？", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1004, 0, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 1, "穂高 みそぎ", 1.5, "ねぇ、にいちゃん！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1006, 0, "ねぇ…", "私といっしょに…\nいかない？", 1, 1, "風宮 あかり", 1.4, "風宮あかりです", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1007, 0, "プリンたべたいのー", "食べ物の恨みは怖いのー", 1, 1, "出雲 宮子", 1.5, "出雲宮子なのー", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1008, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 1, 1, "虹村 雪", 1.4, "ボクは虹村雪。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1009, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 1, 1, "柊杏奈", 1.4, "フッ…聞いて後悔するがいい！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1010, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 1, 1, "姫宮 真歩", 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1011, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 1, 1, "衣之咲 璃乃", 1.4, "衣之咲璃乃です！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1012, 0, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 1, 1, "柏崎 初音", 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1016, 0, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 1, "美波 鈴奈", 1.4, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1017, 0, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 1, 1, "喜屋武 香織", 1.4, "はいたーい。\n喜屋武香織さー。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1018, 0, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 1, 1, "支倉 伊緒", 1.4, "支倉伊緒です。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1020, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 1, 1, "茜 ミミ", 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1021, 0, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 1, 1, "栗林 くるみ", 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1022, 0, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 1, 1, "風宮 より", 1.4, "風宮よりです。\nあああああ！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1023, 0, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 1, 1, "北条 綾音", 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1025, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 1, 1, "天野 すずめ", 1.4, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1027, 0, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 1, 1, "倉石 恵理子", 1.4, "……クスクス…私は\n…倉石恵理子……", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1028, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 1, 1, "佐々木 咲恋", 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1029, 0, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 1, 1, "桜井 望", 1.4, "桜井望だよ！\nよろしくねっ", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1030, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 1, "ニノン・ジュベール", 1.4, "デケデケデンっ！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1031, 0, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 1, 1, "上喜 しのぶ", 1.4, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1033, 0, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 1, 1, "野戸まひる", 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1034, 0, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 1, 1, "綾瀬 ゆかり", 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1036, 0, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 1, 1, "氷川 鏡華", 1.5, "氷川鏡華…です", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1038, 0, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 1, "柏崎 栞", 1.4, "柏崎…栞です。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1040, 0, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 1, 1, "双葉 碧", 1.4, "ふ、双葉碧です。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1042, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 1, 1, "三角 千歌", 1.4, "三角千歌です。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1043, 0, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 1, 1, "安芸 真琴", 1.4, "安芸真琴だ。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1044, 0, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 1, "イリヤ・オーンスタイン", 1.4, "わらわこそは夜を総べる者！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1045, 0, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 1, 1, "遠見 空花", 1.4, "そこで騎士は妖精を乱暴に……", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1046, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 1, "宮坂たまき", 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1048, 0, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 1, "大神 美冬", 1.4, "大神美冬よ！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1049, 0, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 1, "星野静流", 1.4, "星野静流だよ！", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1050, 0, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 1, "玉泉美咲", 1.5, "アタシは玉泉美咲。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1052, 0, "？？？？", "？？？？", 1, 1, "リマ", 1.4, "？？？", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1053, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1, "モニカ・ヴァイスヴィント", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1058, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1, "ペコリーヌ", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1059, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1, "コッコロ", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, 2, 1060, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1, "キャル", 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, 0, 0);
